import React from 'react'
import { getDataByToken } from '../fetch'

const UserInfo = () => {
    let fetch_result = async () => await getDataByToken("http://127.0.0.1:5000/@me")
    alert(fetch_result)
    if (fetch_result[1] === 200) {
      return (
        <div>
            <div>
              <p>Nick: {fetch_result[1]}</p>
            </div>
            <div>
              <p>Email: {fetch_result[3]}</p>
            </div>
        </div>
      )
    }
    else if (fetch_result[1] === 401) {
      window.location.href = '/login'
    }
    else {
      alert('do not ya have no rights for this page, kurwa?')
      window.location.href = '/login'
    }
    
}

export default UserInfo
